                    autoclose: true,
                    twelvehour: false
                });

                scheduleList = $("".clock"");
                daysList = $("".days"");
                deleteBtns = $("".delete-schedule"");

                //*** REMOVE SCHEDULE ***//
                $(deleteBtns).click(function () {
                    if ($(this).parent().parent().prop(""id"") !== ""schedule-0"")
                        $(this).parent().add($(this).parent().prev()).remove();
